Upgrading this dependency from `1.1.4` to `1.3.0` introduces a potential risk.

The `MySqlPlugin.java` file uses a driver-specific class `org.mariadb.r2dbc.message.server.ColumnDefinitionPacket` directly. Specifically, in the `getRow(Row, RowMetadata)` method (line 614), it casts `meta.getColumnMetadatas().iterator()` to an iterator of this specific class.

```java
// MySqlPlugin.java:614
private Map<String, Object> getRow(Row row, RowMetadata meta) {
    Iterator<ColumnDefinitionPacket> iterator =
            (Iterator<ColumnDefinitionPacket>) meta.getColumnMetadatas().iterator();
    // ...
}
```

This is a fragile implementation that relies on the internal details of the `r2dbc-mariadb` driver. While this might work with version 1.1.4, there's no guarantee it will work with 1.3.0. A change in the driver's internal implementation could lead to a `ClassCastException` at runtime.

It is highly recommended to perform thorough regression testing, especially for queries that return various data types, to ensure this upgrade does not introduce any runtime errors. Ideally, the code should be refactored to avoid using driver-specific implementation classes and rely only on the standard R2DBC API (`io.r2dbc.spi.*`).
